import React from "react";
import { Link } from "react-router-dom";

export default function NavBar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark fixed-top" style={{ backgroundColor: "#1A1A1A" }}>
      <div className="container-fluid">
        <Link to="/" className="navbar-toggler" aria-label="Toggle navigation">
          <i className="fas fa-bars mr-3" /> Dennis Mbugua
        </Link>

        <div className="collapse navbar-collapse justify-content-center" id="navbarCenteredExample">
          <ul className="navbar-nav">
          <li className="nav-item">
              <Link className="nav-link active fw-bold" to="/" style={{ fontSize: "20px" }}>
                Dennis
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link active fw-bold" to="/me" style={{ fontSize: "20px" }}>
                About Me
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white fw-bold" to="/articles" style={{ fontSize: "20px" }}>
                Articles
              </Link>
            </li>
            <li className="nav-item">
              <Link
                className="nav-link text-white fw-bold btn btn-block text-capitalize"
                to="/hire-me"
                style={{ fontSize: "20px", backgroundColor: "#007BFF" }}
              >
                Work with Me
              </Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}
